package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import com.fasterxml.jackson.databind.annotation.JsonDeserialize;import com.fasterxml.jackson.databind.annotation.JsonSerialize;import com.rongke.utils.DateJsonDeserializer;import com.rongke.utils.DateJsonSerializer;import org.springframework.format.annotation.DateTimeFormat;import java.io.Serializable;/** * @AppFeedback * @用户反馈(app_feedback) * @version : Ver 1.0 */@TableName("app_feedback")public class AppFeedback implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	/**	 * @备注:	 * @字段:user_id BIGINT(19)	 */	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long userId;	/**	 * 备注:	 */	@TableField(exist = false)	private User user;	/**	 * @备注:内容	 * @字段:content MEDIUMTEXT(16777215)	 */	private String content;	/**	 * @备注:	 * @字段:img_url VARCHAR(255)	 */	private String imgUrl;	/**	 * @备注:手机号	 * @字段:phone VARCHAR(255)	 */	private String phone;	/**	 * @备注:	 * @字段:gmt_datetime DATETIME(19)	 */	@JsonSerialize(using=DateJsonSerializer.class)	@JsonDeserialize(using=DateJsonDeserializer.class)	@DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss" )	private java.util.Date gmtDatetime = new java.util.Date();	/**	 * @备注:	 * @字段:upt_datetime DATETIME(19)	 */	@JsonSerialize(using=DateJsonSerializer.class)	@JsonDeserialize(using=DateJsonDeserializer.class)	@DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss" )	private java.util.Date uptDatetime = new java.util.Date();	/**	 * @备注:用户还是客服	 * @字段:type VARCHAR(10)	 */	private String type;	/**	 * @备注:状态	 * @字段:status VARCHAR(10)	 */	private String status;	/**	 * @备注:暂存	 * @字段:temp MEDIUMTEXT(16777215)	 */	private String temp;	@TableField(exist = false)	private String authStatus;	public AppFeedback(){	}	public AppFeedback(		Long id	){		this.id = id;	}	public void setId(Long id) {		this.id = id;	}	public Long getId() {		return this.id;	}	public void setUserId(Long userId) {			this.userId = userId;			}	public Long getUserId() {			return this.userId;	}	public void setUser(User user) {		this.user = user;	}	public User getUser() {		return this.user;	}	public void setContent(String content) {		this.content = content;	}	public String getContent() {		return this.content;	}	public void setImgUrl(String imgUrl) {		this.imgUrl = imgUrl;	}	public String getImgUrl() {		return this.imgUrl;	}	public void setPhone(String phone) {		this.phone = phone;	}	public String getPhone() {		return this.phone;	}	public void setGmtDatetime(java.util.Date gmtDatetime) {		this.gmtDatetime = gmtDatetime;	}	public java.util.Date getGmtDatetime() {		return this.gmtDatetime;	}	public void setUptDatetime(java.util.Date uptDatetime) {		this.uptDatetime = uptDatetime;	}	public java.util.Date getUptDatetime() {		return this.uptDatetime;	}	public String getType() { return type; }	public void setType(String type) { this.type = type; }	public String getStatus() { return status; }	public void setStatus(String status) { this.status = status; }	public String getTemp() { return temp; }	public void setTemp(String temp) { this.temp = temp; }	public String getAuthStatus() { return authStatus; }	public void setAuthStatus(String authStatus) { this.authStatus = authStatus; }}